window.bookSummaryJSON = "<p>They say there's no rest for the wicked, and New Orleans never knew how true that was until I came to town. </p> <p>Nobody told me that when I entered the transition, the very gifts of my demonic lineage would be used against me. Nobody warned me that the flames of hell would burn from within. Or that I'd be driven to lust and madness, my chaotic magic becoming more wild and unruly than ever before. </p> <p>The only way to save myself - and the world - was to give the beast what she wanted: control. </p> <p>As if transitioning wasn't enough, my presence was now known, and my enemies were mounting. While the beast was intent on claiming our Four Horsemen, there were things to be done. People to find. Demons to kill. </p> <p>And when they make a deal with the devil - let's just say that neither world will ever be the same again. </p> <p>Long live the queen. If I can survive becoming immortal, that is. </p> <p>Contains mature themes.</p>"; 
